const Useffect = ()=>{

    const [count , setCount] = useState(0)

   const  increment = ()=>{

        setCount(count+1)
    }
    return(
        <>
            <h1>{count}</h1>
            <button onClick={increment}>update</button>
        </>
    )
}

export default Useffect;
